script: |
  super -f text -I q13690.spq | sort > q13690.out

inputs:
  - name: q13690.spq
    data: |
      SELECT - 93 FROM tab0 (FORMAT parquet) AS cor0 WHERE - col0 + + ( + + col2 ) NOT IN ( - 78 * + ( - - 1 ), - col0 * 89 * - col2 );
  - name: tab0

outputs:
  - name: q13690.out
    data: |
      -93
      -93
      -93
